import React from 'react';
import { useNavigate } from 'react-router-dom';
import './mainpage.css';
import Background from './Background';

const MainPage = () => {
  const navigate = useNavigate();

  const handleVisualizerClick = () => {
    navigate('/visualizer');
  };

  return (
    <div className="mainpage">
      <Background />
      <div className="content">
        <h1 className="title">Welcome to the Algorithm Visualizer</h1>
        <p className="subtitle">Dive into the world of algorithms with stunning visualizations.</p>
        <button className="direct" onClick={handleVisualizerClick}>
          Get Started
        </button>
        <div className="features">
          <h2>Features:</h2>
          <ul>
            <li>Interactive visualizations</li>
            <li>Step-by-step algorithm breakdown</li>
            <li>Customizable input data</li>
            <li>Real-time performance insights</li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default MainPage;
